+}
+
+.ccontact-section {
+    padding: 180px 0 160px;
+    background: var(--black100);
+    position: relative;
+    height: 100vh;
+    font-family: "PT Sans", sans-serif;
+
+    .container {
+        position: relative;
+        z-index: 2;
+    }
+}
+
+.ccontact-section__left {
+    .title {
+        font-family: 'PowerGrotesk';
+        font-weight: 500;
+        font-size: 48px;
+        line-height: 120%;
+        margin-bottom: 20px;
+        color: #fff;
+    }
+
+    .description {
+        max-width: 401px;
+        margin-bottom: 54px;
+        color: var(--dark-grey);
+    }
+
+    .ccontact-section__count {
+        display: flex;
+        flex-wrap: wrap;
+        justify-content: space-between;
+        max-width: 418px;
+
+        .item {
+            width: 100%;
+            max-width: 94px;
+            flex: 0 0 94px;
+
+            span {
+                display: block;
+                color: var(--lime);
+                font-size: 40px;
+                font-weight: 500;
+                font-family: 'PowerGrotesk';
+            }
+
+            p {
+                margin: 0;
+                color: var(--dark-grey);
+                font-size: 14px;
+                line-height: 140%;
+            }
+        }
+    }
